import signUpImage from './signUpImage.jpg'
import classes from './Signup.module.css'

const Signup = () => {

    return (
      <div className={classes.sign_up}>
        <div>
          <h1>Join Meetup</h1>
          <p>
            People use Meetup to meet new people, learn new things, find
            support, get out of their comfort zones, and pursue their passions,
            together. Membership is free.
          </p>
          <button className={classes.btn_round}>Sign up</button>
        </div>
        <img src={signUpImage} alt="group" />
      </div>
    );
}
export default Signup;
